import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expense = [
    { title: "Car Insurance", amount: 293.34, date: new Date(2023, 2, 28) },
    { title: "Car Insurance", amount: 193.34, date: new Date(2023, 4, 28) },
    { title: "Car Insurance", amount: 5693.34, date: new Date(2023, 5, 18) },
    { title: "Car Insurance", amount: 233.34, date: new Date(2023, 3, 8) },
  ];
  return (
    <div>
      <h2>Let's get started right now!</h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
